import { Route } from "react-router-dom";
import AllMeetupPage from "./pages/AllMeetups";
function App(){
    return (
        <div>
        <Route path='/'>
            <AllMeetupPage />
        </Route>
        <Route path='/'>
        <AllMeetupPage />
    </Route>
    <Route path='/'>
    <AllMeetupPage />
</Route>
</div>
    );
}

export default App;
